import React from "react";
import Countdown from "react-countdown";
export default function TimeCounter({ hr }) {
  console.log(Date.now());
  const Completionist = () => <span>BOo0o0o0M!!!!!</span>;

  const renderer = ({ hours, minutes, seconds, completed }) => {
    if (completed) {
      // Render a complete state
      return <Completionist />;
    } else {
      // Render a countdown
      return (
        <>
          <span
            style={{
              color: "black",
              padding: "10px",
              borderColor: "orange",
              borderStyle: "solid",
              borderRadius: "1rem",
            }}
          >
            {hours}
          </span>
          <span style={{ color: "orange", fontSize: "3rem" }}> Hr </span>
          <span
            style={{
              color: "black",
              borderColor: "orange",
              borderStyle: "solid",
              borderRadius: "1rem",
            }}
          >
            {minutes}
          </span>
          <span style={{ color: "orange", fontSize: "3rem" }}> min </span>
          <span
            style={{
              color: "black",
              borderColor: "orange",
              borderStyle: "solid",
              borderRadius: "1rem",
            }}
          >
            {seconds}
          </span>
          <span style={{ color: "orange", fontSize: "3rem" }}> seg </span>
        </>
      );
    }
  };
  return <Countdown date={Date.now() + hr * 3600000} renderer={renderer} />;
}
